COPY public.psu (id, kategori, jenis, judul, deskripsi) FROM stdin;
1	1	1	Jalan Raya	Jalan utama yang menghubungkan antar kota atau antar wilayah.
2	1	1	Jalan Tol	Jalan berbayar dengan akses terbatas untuk kendaraan.
3	1	1	Jalan Lingkungan	Jalan yang melayani akses di dalam perumahan atau lingkungan lokal.
4	1	1	Jembatan	Struktur yang menghubungkan dua titik di atas rintangan seperti sungai atau lembah.
5	1	1	Trotoar	Area untuk pejalan kaki di sepanjang jalan.
6	1	1	Lampu Jalan	Penerangan di sepanjang jalan untuk keselamatan dan keamanan.
7	1	2	Saluran Terbuka	Parit atau kanal yang terbuka untuk mengalirkan air permukaan.
8	1	2	Saluran Tertutup	Pipa atau gorong-gorong yang mengalirkan air di bawah tanah.
9	1	2	Kolam Retensi	Kolam yang dibuat untuk menampung air hujan sementara sebelum dialirkan.
10	1	2	Pompa Air	Alat untuk mengalirkan air dari tempat yang lebih rendah ke tempat yang lebih tinggi atau keluar dari area yang banjir.
11	1	3	Instalasi Pengolahan Air (IPA)	Fasilitas untuk mengolah air baku menjadi air bersih yang layak minum.
12	1	3	Reservoir	Tangki atau waduk untuk menyimpan air bersih.
13	1	3	Jaringan Pipa Distribusi	Pipa yang mengalirkan air bersih dari instalasi pengolahan ke rumah-rumah atau bangunan.
14	1	3	Pompa Air	Alat untuk mengalirkan air melalui jaringan distribusi.
15	1	4	Toilet	Fasilitas dasar untuk pembuangan tinja dan urine.
16	1	4	Septic Tank	Tangki bawah tanah untuk pengolahan limbah domestik secara anaerob.
17	1	4	MCK (Mandi, Cuci, Kakus)	Fasilitas umum untuk mandi, mencuci, dan buang air di area publik atau pemukiman padat.
18	1	5	Instalasi Pengolahan Air Limbah (IPAL)	Fasilitas untuk mengolah air limbah sebelum dibuang ke lingkungan.
19	1	5	Jaringan Pipa Air Limbah	Pipa yang mengalirkan air limbah dari sumbernya ke instalasi pengolahan.
20	1	5	Kolam Oksidasi	Kolam yang digunakan untuk mengolah air limbah secara alami dengan bantuan oksigen.
21	1	5	Pompa Air Limbah	Alat untuk memindahkan air limbah melalui jaringan pipa atau dari tempat rendah ke tempat yang lebih tinggi.
22	2	6	Pusat Perbelanjaan/Mal	Gedung besar dengan berbagai toko dan fasilitas hiburan.
23	2	6	Pasar Tradisional	Area di mana pedagang menjual berbagai barang kebutuhan sehari-hari.
24	2	6	Supermarket dan Minimarket	Toko besar atau kecil yang menjual barang-barang kebutuhan rumah tangga.
25	2	6	Toko dan Kios	Unit usaha kecil yang menjual barang-barang tertentu.
26	2	7	Kantor Pemerintahan	Gedung untuk aktivitas administrasi pemerintahan (seperti balai kota, kantor kecamatan).
27	2	7	Kantor Polisi	Bangunan yang digunakan oleh kepolisian untuk operasional sehari-hari.
28	2	7	Kantor Pos	Tempat untuk layanan pengiriman surat dan paket.
